import React from "react";
import { Image, View, SafeAreaView, TouchableOpacity, Text, TouchableHighlight } from "react-native";
import Constants from "expo-constants";
import Icon from "react-native-vector-icons/MaterialIcons";
import Icons from "react-native-vector-icons/AntDesign";
import Iconss from "react-native-vector-icons/Ionicons";


import Avataar from "../../../../assets/Avatar.png"
import Colors from '../../../../Configs/Colors/Colors';
import ProfileStyle from '../../../../Configs/Style/ProfileStyle';
// import STYLES from '../../../../Configs/Style/formStyles';
import AsyncStorage from "@react-native-async-storage/async-storage";
import {navigationRef} from "../../Forms/Modal"
import axios from "axios";
// Array [
//     "First_name",
//     "Photo",
//     "Second_Name",
//     "isLogedin",
//     "login_token",
//     "signup_token",
//   ]
const ProfilePage = () => {
    let [name,setName]=React.useState("")
    let [photo,setPhoto]=React.useState("")
    AsyncStorage.multiGet(["First_name","Photo",],(err,res)=>{
        setName(res[0][1])
        setPhoto(res[1][1])
    })

    let image_avatar ="data:image/png;base64,";
    function getPic(){
        if (photo==""){
            return <Image source={{uri:image_avatar}} style={ProfileStyle.ProfileImage} />
        }
        else{
            return <Image source={{uri:photo}} style={ProfileStyle.ProfileImage} />
        }
    }
    return (<SafeAreaView>
            <TouchableHighlight>
                <View style={ProfileStyle.container}>
                    <View style={ProfileStyle.View}>
                        { getPic() }
                        <TouchableOpacity>
                            <Text style={[ProfileStyle.Font, ProfileStyle.FontSpace, ProfileStyle.ProfileName]}>{name}</Text>
                        </TouchableOpacity>
                    </View>

                    <View style={ProfileStyle.Line} />

                    <TouchableOpacity onPress={_=>navigationRef.navigate("Address")} >
                        <View style={ProfileStyle.View}>
                            <Iconss
                                name='location-outline'
                                color={Colors.grey}
                                size={40}
                                style={ProfileStyle.IconSpace}
                            />
                            <Text style={[ProfileStyle.Font, ProfileStyle.FontSpace]} >Address</Text>
                        </View>
                    </TouchableOpacity>

                    <View style={ProfileStyle.Line} />

                    <TouchableOpacity onPress={()=>navigationRef.navigate("WishList")}>
                        <View style={ProfileStyle.View}>
                            <Icon
                                name='favorite-border'
                                color={Colors.grey}
                                size={40}
                                style={ProfileStyle.IconSpace}
                            />
                            <Text style={[ProfileStyle.Font, ProfileStyle.FontSpace]} >Wish list</Text>
                        </View>
                    </TouchableOpacity>

                    <View style={ProfileStyle.Line} />

                    <TouchableOpacity onPress={()=>navigationRef.navigate("OrderList")}>
                        <View style={ProfileStyle.View}>
                            <Icon
                                name='shopping-cart'
                                color={Colors.grey}
                                size={40}
                                style={ProfileStyle.IconSpace}
                            />
                            <Text style={[ProfileStyle.Font, ProfileStyle.FontSpace]} >My Orders</Text>
                        </View>
                    </TouchableOpacity>

                    <View style={ProfileStyle.Line} />

                    <TouchableOpacity onPress={_=>navigationRef.navigate("ComplainScreen")}>
                        <View style={ProfileStyle.View}>
                            <Icons
                                name='customerservice'
                                color={Colors.grey}
                                size={40}
                                style={ProfileStyle.IconSpace}
                            />
                            <Text style={[ProfileStyle.Font, ProfileStyle.FontSpace]} >Complain</Text>
                        </View>
                    </TouchableOpacity>

                    <View style={ProfileStyle.Line} />
                    <TouchableOpacity onPress={logout}>
                        <View style={ProfileStyle.View}>
                            <Icons
                                name='logout'
                                color={Colors.grey}
                                size={40}
                                style={ProfileStyle.IconSpace}
                            />
                            <Text style={[ProfileStyle.Font, ProfileStyle.FontSpace]} >Log Out</Text>
                        </View>
                    </TouchableOpacity>
                    <View style={ProfileStyle.Line} />
                </View>
            </TouchableHighlight>
        </SafeAreaView >
    );
};

function logout(){
    AsyncStorage.getItem("login_token",(err,res)=>{
        if(res){
            console.log("token here",res)
            var x = "Token "+res
            axios.post("http://apiservice.ddns.net/user/logout/",{},{headers:{Authorization:x}})
            .then((response)=>{
                switch(response.status){
                    case 400:
                        alert("oops something went wrong")
                        navigationRef.navigate("Home ")
                        break;
                    case 200:
                        AsyncStorage.multiRemove(['First_name','Photo','Second_Name','isLogedin','login_token','signup_token'], (err) => {
                            AsyncStorage.setItem("isLogedin","false")
                        });
                        navigationRef.navigate("Home ")
                        break;
                }
            })
            .catch((err)=>{
                if(err.request.status==401){
                    console.log(err)
                    AsyncStorage.multiRemove(['First_name','Photo','Second_Name','isLogedin','login_token','signup_token'], (err) => {
                        AsyncStorage.setItem("isLogedin","false")
                    });
                    navigationRef.navigate("Home ")
                    alert("ooops something went wrong!")
                }
            })
        }

    })
}


export default ProfilePage;
